import {Container,Row,Col} from 'react-bootstrap'
import { CommentMedia, CustomMedia } from "./CommentMedia";
import ShopCart from '../Shop/ShopCard';
import BasicShop from '../Shop/BasicShop';

 
export default function RelatedVideo() {
	return (
		<>
			 
             <ContentWrapper>
				<Container fluid>
					<div className="video-block-right-list section-padding"  >
						<Row className="mb-4"  >
							<Col md={8} className="smFixedVideo"    >
							{  
		   vedoreViedo.map((vendorVideo)=>( 
	 id==vendorVideo.id &&   <VideoFrame key={vendorVideo.key} vendorVideo={vendorVideo} />
	 
	 ) )
		   
		}
		
							

			 
								 
							</Col>

							<Col md={4}  className="leftItems" >
							<div className="video-slider-right-list"     >
							{products.map((product) => (
        
				  <VideoProduct
					 product={product} 
				  />
                  
                 
              ))}
			  </div>			 
							</Col>
						</Row>
					</div>

					<div className="video-block section-padding sm-position" >
						<Row>
							<Col md={8} className='tagItem' >
							{  
		   vedoreViedo.map((vendorVideo)=>( 
	 id==vendorVideo.id &&   <SingleVideoLeft key={vendorVideo.key} vendorVideo={vendorVideo} />
	 
	 ) )
		   
		}
						 
							 
								 
							</Col>

							<Col md={4}>
								<SingleVideoRight />
							</Col>
						</Row>
					</div>
				</Container>
				<ThinFooter />
			</ContentWrapper>
					 
				 
		  
		</>
	);
}
